window.evergageBeforeSiteConfigExecution = function() {
    try {
//Track Cancelation Reason
if (/^\/orders\/\d+\/cancellations\/new$/.test(window.location.pathname)) {
    Evergage.safeSubmit('form#new_cancellation',function() {
        var cancelReason = ajq('#cancellation_cancellation_reason_id option:selected').text();
        Evergage.setUserField('CancelReason', cancelReason);
        Evergage.trackAction('Cancel your Subscription - Clicked Cancel');
    });
}

//Track Modal Clicks
Evergage.safeClick('div.modal-footer > div > div.span6.text-right > a', function() {
    var actionName = Evergage.util.getPathname(window.location).slice(1);
    if(actionName.indexOf("/") !== -1) {
        actionName = actionName.slice(0, actionName.indexOf("/"));
    }
    actionName = actionName.substring(0, 1).toUpperCase() + actionName.substring(1) + " - Get Started Modal Click";
    Evergage.trackAction(actionName);
});

//Track Plan Update
if(/^\/billing\/upgrades\/payment.*$/.test(window.location.pathname)) {
    Evergage.safeClick('form#new_upgrade button#submit_button', function() {
        var planUpgrade = ajq('#upgrade_product_id').val();
        //Evergage.setUserField('Plan Update', planUpgrade);
        Evergage.trackAction('Update my Plan');
    });
}
    } catch (e) {
        if (typeof window.Evergage === "object" && typeof window.Evergage.getVersion === "function" && window.Evergage.getVersion() >= 5) {
            Evergage.sendException(e, "siteWideJavascript");
        }
    }
};

